    uint256 public devSellFee = 1; 
    uint256 public burnSellFee = 0;

    uint256 public constant tSupply = 1_000_000_000 * (10**18);
    uint256 public maxBuyTransactionAmount = tSupply * 3 / 100;
    uint256 public maxSellTransactionAmount = tSupply * 3 / 100;
    uint256 public swapTokensAtAmount = tSupply * 5 / 10000;
    uint256 public maxWalletToken = tSupply * 3 / 100;

    address payable public _marketingAddress = payable(0x6C6Dd0BE8Cc71C411B247fdDFEFEe9712614d3De);
